import './App.css';
import PlayerSetup from './PlayerSetup.js';


function App() {
  return (
    <div>
      <header className="App-header">
        <h1>Board Game Clock</h1>
      </header>
      <div>
        <PlayerSetup />
      </div>
      <div>
        <button onClick={window.location.reload()}> Refresh Game </button>
      </div>
    </div>
  );
}

export default App;
